import React from "react";
import MyServices from "./MyServices"; // Assurez-vous d'importer le composant MyServices

const ServicesList = () => {
  const services = [
    {
      id: 1,
      title: "Master Chefs",
      description: "Experience the finest dishes from expert chefs.",
      icon: "fa fa-hat-chef",
    },
    {
      id: 2,
      title: "Quality Food",
      description: "Delicious food made with fresh, high-quality ingredients.",
      icon: "fa fa-utensils",
    },
    {
      id: 3,
      title: "Online Order",
      description: "Order your favorite dishes online and get them delivered.",
      icon: "fa fa-cart-plus",
    },
    {
      id: 4,
      title: "24/7 Services",
      description: "We're available to serve you anytime, anywhere.",
      icon: "fa fa-headset",
    },
  ];

  return (
    <div className="flex flex-wrap justify-center">
      {services.map((service) => (
        <MyServices
          key={service.id}
          title={service.title}
          description={service.description}
          icon={service.icon}
        />
      ))}
    </div>
  );
};

export default ServicesList;
